[Form]
public class InventOnhandMovement extends FormRun
{
    InventDimCtrl_Frm_OnhandMovement    inventDimFormSetup;

    [SysObsolete('The inventToSecondaryUnitConverter is deprecated, used productInventToSecondaryUnitConverter instead', false, 31\03\2019)]
    UnitOfMeasureConverter_Product      inventToSecondaryUnitConverter;
    [SysObsolete('The secondaryToInventUnitConverter is deprecated, used productSecondaryToInventUnitConverter instead', false, 31\03\2019)]
    UnitOfMeasureConverter_Product      secondaryToInventUnitConverter;

    EcoResProductUnitConverter          productInventToSecondaryUnitConverter;
    EcoResProductUnitConverter          productSecondaryToInventUnitConverter;

    [FormObservable]
    UnitOfMeasureSymbol                 unitIdInvent;
    UnitOfMeasureSymbol                 unitIdSecondary;

    [FormObservable]
    boolean                             reserveOnOrdered;

    InventCostPriceCache                inventCostPriceCache;

    InventAvailabilityFormCache         inventAvailabilityFormCache;
    InventDim                           inventDimDisplay;

    FormObservableLink                  unitSymbolCurrent = new FormObservableLink();
    FormObservableLink                  unitSymbolComboBoxCurrent = new FormObservableLink();

}

private boolean useCatchWeightAvailabilityCache(InventSum _inventSum)
{
    if (!_inventSum.Itemid)
    {
        return false;
    }

    return WHSInventTable::isItemWHSAndCatchWeightEnabled(_inventSum.Itemid);
}

public void applyUnitID()
{
    UnitOfMeasureSymbol tempUnitID;

    // If we don't have an item, then units don't matter
    if (!inventSum.ItemId)
    {
        return;
    }

    boolean allowEditUnit;
    [tempUnitID, allowEditUnit] = InventOnhand::inventModuleUnitsSelectionToUnitIdAllowEdit(unitsComboBox.selection(), inventSum.ItemId, unitIdSecondary);
    ctrlUnitId.allowEdit(allowEditUnit);

    // Units may be empty, if so fall back to inventory units
    if (!tempUnitID)
    {
        unitsComboBox.selection(InventModuleUnits::InventoryUnit);
        tempUnitID = unitIdInvent;
        info("@SYS113267");
    }

    // Apply new unit
    element.unitId(true, tempUnitID);
}

boolean canClose()
{
    return true;
}

public Common docCursor()
{
    return null;
}

void handleNoOnHand()
{
    Object fc;
    int    y;

    if (inventSum.ItemId || !inventDimFormSetup.movement())
    {
        return;
    }

    for (fc=inventDimFormSetup.inventDimControls().first();fc;fc=inventDimFormSetup.inventDimControls().next())
    {
        if (fc.visible())
        {
            y = inventDimFormSetup.inventDimControls().fieldId(fc);
            inventDim.(y) = inventDimFormSetup.inventdim().(y);
        }
    }
    inventDim_DS.refresh();
}

void init()
{
    if (!element.args() || !element.args().record())
    {
        throw error(Error::missingFormActiveBuffer(formStr(InventOnhandMovement)));
    }

    this.initUnitConverters();
    super();

    inventAvailabilityFormCache = InventAvailabilityFormCache::construct();
    element.updateDesign(InventDimFormDesignUpdate::Init);
}

/// <summary>
/// Initializes an <c>InventDim</c> record based on dimensions shown in the form.
/// </summary>
public void initInventDimDisplay()
{
    inventDimDisplay.initFromInventDim(element.inventDimSetupObject().inventdim(),
        element.inventDimSetupObject().parmDimParmVisibleGrid().selectedDimFields());
}

/// <summary>
/// Does initialization of the unit of measure converters.
/// </summary>
private void initUnitConverters()
{
    productInventToSecondaryUnitConverter   = EcoResProductUnitConverter::construct();
    productSecondaryToInventUnitConverter   = EcoResProductUnitConverter::construct();

    productInventToSecondaryUnitConverter.parmApplyRounding(NoYes::Yes);
    productSecondaryToInventUnitConverter.parmApplyRounding(NoYes::No);
    productInventToSecondaryUnitConverter.parmRoundAbsoluteValue(NoYes::Yes);
    productSecondaryToInventUnitConverter.parmRoundAbsoluteValue(NoYes::Yes);
}

InventDimCtrl_Frm_OnhandMovement inventDimSetupObject()
{
    if (!inventDimFormSetup)
    {
        inventDimFormSetup  = InventDimCtrl_Frm_OnhandMovement::newFromForm(element);
        inventDimFormSetup.parmLargeRightClickForm(NoYes::Yes);
    }
    return inventDimFormSetup;
}

