/// <summary>
/// Sets up the parameters of the unit of measure converters according to current selection on the form.
/// </summary>
private void setupUnitConverters()
{
    productInventToSecondaryUnitConverter.parmFromUnitOfMeasureSymbol(unitIdInvent);
    productInventToSecondaryUnitConverter.parmToUnitOfMeasureSymbol(unitIdSecondary);

    InventMovement movement = element.inventDimSetupObject().movement();
    productInventToSecondaryUnitConverter.parmItemId(movement.itemId());
    productInventToSecondaryUnitConverter.parmInventDimId(movement.inventDimId());

    productSecondaryToInventUnitConverter.parmFromUnitOfMeasureSymbol(unitIdSecondary);
    productSecondaryToInventUnitConverter.parmToUnitOfMeasureSymbol(unitIdInvent);
    productSecondaryToInventUnitConverter.parmItemId(productInventToSecondaryUnitConverter.parmItemId());
    productSecondaryToInventUnitConverter.parmInventDimId(productInventToSecondaryUnitConverter.parmInventDimId());
}

/// <summary>
/// Set the <c>UnitsComboBox</c> value according to current value.
/// </summary>
private void setupUnitsComboBox()
{
    if (unitIdSecondary == unitIdInvent)
    {
        unitsComboBox.selection(InventModuleUnits::InventoryUnit);
        return;
    }

    if (element.inventDimSetupObject().movement() is InventMov_Sales)
    {
        unitsComboBox.selection(InventModuleUnits::SalesUnit);
        return;
    }

    if (element.inventDimSetupObject().movement() is InventMov_Purch)
    {
        unitsComboBox.selection(InventModuleUnits::PurchaseUnit);
        return;
    }

    unitsComboBox.selection(InventModuleUnits::None);
}

edit UnitOfMeasureSymbol unitId(boolean _set, UnitOfMeasureSymbol _unitId)
{
    unitSymbolComboBoxCurrent.observe();
    if (_set)
    {
        if (!UnitOfMeasure::unitOfMeasureIdBySymbol(_unitId))
        {
            checkFailed(strFmt("@SYS316757", tablePName(UnitOfMeasure)));
            return unitIdSecondary;
        }

        InventMovement movement = element.inventDimSetupObject().movement();
        if (!EcoResProductUnitConverter::canBeConvertedGivenUnitSymbolsForReleasedProduct(
                movement.itemId(),
                movement.inventDimId(),
                unitIdInvent,
                _unitId))
        {
            checkFailed(strFmt("@SYS28690", unitIdInvent, _unitId));
            return unitIdSecondary;
        }

        unitIdSecondary = _unitId;
        element.setupUnitConverters();
        unitSymbolCurrent.markChanged();
        inventSum_ds.refresh();
    }

    return unitIdSecondary;
}

display UnitOfMeasureSymbol unitIdInvent()
{
    return unitIdInvent;
}

void updateDesign(InventDimFormDesignUpdate _mode)
{
    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init:
            reserveOnOrdered = InventParameters::find().ReserveOnOrdered;
            RowAvailReserveGroupPhysical.visible(!reserveOnOrdered);
            RowAvailableForReservation.visible(reserveOnOrdered);
        // No break
        case InventDimFormDesignUpdate::LinkActive:
            element.inventDimSetupObject().initFromCaller();
            element.inventDimSetupObject().parmDimParmVisible(element.inventDimSetupObject().parmDimParmVisibleGrid());
            unitIdSecondary = element.inventDimSetupObject().movement().transUnitId();
            unitIdInvent = element.inventDimSetupObject().movement().inventTable().inventTableModuleInvent().UnitId;
            this.setupUnitsComboBox();
            this.setupUnitConverters();
        // No break
        case InventDimFormDesignUpdate::Active:
            element.inventDimSetupObject().formActiveSetup();
            element.inventDimSetupObject().formSetControls(true,true);
            break;

        default : throw error(strFmt("@SYS54195",funcName()));
    }
}

